import React, {Component} from 'react'

class ProductCard extends Component{

    render(){
        // console.log("ProductCard Props: ", this.props.product)
        let item = this.props.product
        return(<div>
            <h5>{item.name}</h5>
            <p>
                sku: {item.sku} {"\n"}
                color: {item.color}
                <img src={item.image_url} width="100" height="100" alt="product" />

            </p>
            </div>)
